import { Home } from './pages/Home/Home';
import { Admin } from './pages/Admin/Admin';
import { Post } from './pages/Post/Post';

export const routes = [
  {
    path: '/',
    exact: true,
    component: Home
  },
  {
    path: '/home',
    exact: true,
    component: Home
  },
  {
    path: '/admin',
    exact: true,
    component: Admin
  },
  {
    path: '/Post',
    exact: true,
    component: Post
  },
];
